import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import TeamServices from '../../../services/team.services'

const useStyles = makeStyles(theme => ({
    formControl: {
        margin: theme.spacing(1),
        minWidth: 120,
    },
    selectEmpty: {
        marginTop: theme.spacing(2),
    },
}));
getMyTeam = () => {
    this.services.getMyTeam()
        .then(theTeam => this.setState({ team: theTeam }))
        .catch(err => console.log(err))
}
export default function SimpleSelect() {

    const classes = useStyles();
    const [membersteam] = React.useState('');
    const handleChange = event => {
        membersteam(event.target.value);
    };

    return (
        <div>
            <FormControl className={classes.formControl}>
                <InputLabel id="demo-simple-select-label">Seleciona un equipo</InputLabel>
                <Select
                    labelId="demo-simple-select-label"
                    id="demo-simple-select"
                    value={this.state.team.map()}
                    onChange={handleChange}
                >
                    <MenuItem value={this.state.team.map()}>aqui un map de los equipos</MenuItem>
                </Select>
            </FormControl>

        </div>
    );
}
